import PostSmall from '../post/PostSmall'
import Loading from '../Loading'

const PostSmallList = (props) => {

    const postListReady = props.posts.map(p => <PostSmall post={p} user={p.user.username} key={`PSL${p.title}`} />)

    return (
        <React.Fragment>
            {postListReady}
